import './App.css';
import { Navegador } from './componentes/navegador';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import { Home } from './componentes/home';


function App() {
  return (
    <div>
      <Navegador className='navegadorContenedor'/>
      <Router>
        <Routes>
        <Route path='/' element={<Home className='home'></Home>} />

        </Routes>
      </Router>


    </div>
  );
}

export default App;
